import React from "react";
import Ticker from "./Ticker";
import GridLayout from 'react-grid-layout';

const Tickers = ({ tickers, onDelete }) => {
  const layout = [
    { i: 'a', x: 0, y: 0, w: 1, h: 2, static: true },
    { i: 'b', x: 1, y: 0, w: 3, h: 2, minW: 2, maxW: 4 },
    { i: 'c', x: 4, y: 0, w: 1, h: 2 }
  ];

  const Ticksmap = () => {
    console.log("asdasd")
    return (
      <div key="b">
        {tickers.map((ticker) => (
          <Ticker
            key={ticker.id}
            ticker={ticker}
            onDelete={() => onDelete(ticker.id)}
          >
            {ticker.tickername}
          </Ticker>
        ))}
      </div>
    )
  }

  return (
    <>
      <GridLayout className="layout" layout={layout} cols={12} rowHeight={30} width={1200}>
        <div key="a" style={{ color: "green", backgroundColor: "grey" }}>a</div>
        <div key="b" style={{ color: "red", backgroundColor: "grey" }}>b</div>
        <div key="c" style={{ color: "blue", backgroundColor: "grey" }}>c</div>
      </GridLayout>
      <GridLayout cols={7} className="layout">
        {Ticksmap()}
      </GridLayout>
    </>
  );
};

export default Tickers;
